  true,\n\t\"url\": null,\n\t\"notes\": \"The documents in this database are 12 different
  tax forms with the IRS 1040 Package X for the year 1988. These include Forms 1040,
  2106, 2441, 4562, and 6251 together with Schedules A, B, C, D, E, F, and SE. Eight
  of these forms contain two pages or form faces; therefore, there are 20 different
  form faces represented in the database. rnrn The document images in this database
  appear to be real hand-printed forms prepared by individuals, but the images have
  been automatically derived and synthesized using a computer and contain no \"real\"
  tax data. There are 900 simulated tax submissions represented in the database averaging
  6.22 form faces per submission.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
